)":{"notice":"Provide liquidity by depositing NFT tokens"},"exercise(uint256)":{"notice":"Exercise an option based on `_id`"},"getHistoricalPrices()":{"notice":"Returns the historical prices of NFT"},"getNftPrice()":{"notice":"Returns the price of NFT from oracle"},"getPremium(uint256)":{"notice":"Get premium of an option"},"getStrikes(uint256,bool)":{"notice":"Returns the strike prices of an epoch"},"setExpiry(uint256)":{"notice":"Set expiry"},"setLiquidityProvidingTime(uint256)":{"notice":"Set liquidity providing time"},"writeOption()":{"notice":"Writes options"}},"version":1}},"settings":{"compilationTarget":{"contracts/BluebirdOptions.sol":"BluebirdOptions"},"evmVersion":"london","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":200},"remappings":[]},"sources":{"@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol":{"content":"// SPDX-License-Identifier: MIT
